import React from "react";
//import styles from "../styles/cardComponent.module.css";

const DogCard = ({ name, image, temperament, weight }) => {
    return (
      <div>
        <img src={image} alt={`Imagen de ${name}`} />
        <h2>{name}</h2>
        <p>
          <strong>Temperamentos:</strong>{" "}
          {temperament.map((t, i) => (
            <span key={i}>{t}</span>
          ))}
        </p>
        <p>
          <strong>Peso:</strong> {weight.metric} kg ({weight.imperial} lbs)
        </p>
      </div>
    );
  };
  
  export default DogCard
